import React from 'react';
import { Link } from 'react-router-dom';

function Header({ linkPath, linkText, logoSrc, logoAlt }) {
  return (
    <header className="flex justify-between items-center py-4 px-6 bg-gray-200">
      {/* Logo */}
      <div className="flex items-center">
        <img src={logoSrc} alt={logoAlt} className="h-8 w-auto mr-2" />
      </div>

      {/* Link */}
      <Link to={linkPath} className="text-customPurple font-semibold hover:underline">
        {linkText}
      </Link>
    </header>
  );
}

export default Header;
